const counterClosure=(e,t,...n)=>{let s=0;const o=()=>{let o=e(s,...n);return s+=1,s%=t,o};return o};class DequeArray{constructor(e){this.arr=e,this.n=0}get len(){return this.arr.length}curr(){return this.arr[this.n]}next(){return this.n+=1,this.n%=this.len,this.curr()}prev(){return this.n-=1,this.n<0&&(this.n=this.len-1),this.curr()}}const debounce=e=>{let t;return(...n)=>{t&&cancelAnimationFrame(t),t=requestAnimationFrame(()=>{e(...n)})}}